    [],nt"num_tags": 4,nt"name": "non-native-plant-species-sampling-at-lacreek-national-wildlife-refuge-a-prototype-study-fo",nt"isopen":
    false,nt"url": null,nt"notes": "This report describes the results and implications
    of a rapid assessment of nonnative plant invasions at the Lacreek National Wildlife
    Refuge. This effort was a collaborative effort that includes vegetation mapping
    by the Department of Interior Bureau of Reclamation and the US Geological Survey
    and the National Wildlife Refuge Invasive Species Survey. The field inventory identified
    a total of 205 species and 27 non-native species, adding 21 new non-native species
    to the list reported in the Invasive Species Survey. Steep non-native species-accumulation
    curves in the mesic woodland, forbland, upland shrubland, and upland grassland vegetation
    types suggest a vulnerability to invasion that warrants urgent monitoring and control.
    Current control efforts should continue, and new efforts should also target less
    common and newly detected non-native species.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
